import React from 'react'
import './style.css'


export default function PostCard({ id, title, description, likes, firstname, lastname, picture }) {
    return (
        <div className='parent'>
            <h2>{title}</h2>
            <img src={picture} alt={title} />
            <p>{description}</p>
            <p>Likes: {likes}</p>
            <p>Author: {`${firstname} ${lastname}`}</p>
        </div>
    )
}
